import React from 'react';
import './App.css';
import Banner from './components/Banner';
import Exhibit from './components/Exhibit'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <>
        <Router>
          <Banner />
          <Exhibit />
        </Router>
      </>
    );
  }
}

export default App;
